import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

const Header = () => {
  const showNavigation = () => (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
      <a class="navbar-brand" href="absk"></a>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo" aria-expanded="false">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbarTogglerDemo2">
        <ul class="navbar-nav mr-auto mt-2 mt-lg-0">
          <li class="nav-item active">
            <a class="nav-link" href="absk">home<span class="sr-only">(current)</span></a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="absk">Link</a>
          </li>
          <li class="nav-items">
            <a class="nav-link disabled" href="absk" tabindex="-l" aria-disabled="true">Disabled</a>
          </li>
        </ul>
        <form class="form-inline my-2 my-lg-0">
          <input class="form-control mr-sm-2" type="search" placeholder="Search"></input>
          <button class="btn btn-outline-success my-2 my-sn-0" type="submit">Search</button>
        </form>
      </div>
    </nav>

  );

  return <header id="header">{showNavigation()}</header>;
};

export default Header;
